import FlyttstadRumArray from "../components/FlyttstadRumArray";
import { View } from "react-native-web";
import { color } from "react-native/Libraries/Components/View/ReactNativeStyleAttributes";



export default function ChecklistView() {

    return(
        <SafeAreaView style={styles.background}>
            <Header />

            <Text style={styles.arrayHeader}>KÃ–K</Text>


            <FlatList  data={FlyttstadKokArray} renderItem={({ item }) => {
            return <Checkbox style={styles.checkbox}
                    text={item.text}
            /> 
        }}

        //keyExtractor={(item, index) => index.toString()}
        />

        <Text style={styles.arrayHeader}>RUM</Text>

        <FlatList style={styles.checkbox} data={FlyttstadRumArray} renderItem={({ item }) => {
            return <Checkbox
                    text={item.text}
            /> 
        }}

        //keyExtractor={(item, index) => index.toString()}
        />


        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    kategoriStyle: {
        marginLeft: 10,
    },
    arrayHeader:{
        textAlign:"center",
        margin:20,
        fontSize: 20,
        fontWeight: "bold",
        color: "#fff"
    },
    background:{
        backgroundColor: "#4682B4",
